import "./Time.css"

const Time = ({colaboradores, corPrimaria, corSecundaria, nomeDotime, mudarCor})=>{
    
    return(
        colaboradores.length > 0 &&
        <section className="time" style={{backgroundColor: corPrimaria}}>
            <input onChange={e => mudarCor(e.target.value, time.nome)} value={corSecundaria}  type="color" className="colorSet"/>
            <h3 style={{borderColor: corSecundaria}}>{nomeDotime}</h3>
            <div className="colaboradores">
                {colaboradores.map(colaborador => <Colaborador corDeFundo={corSecundaria} key={colaborador.nome} nome={colaborador.nome} cargo={colaborador.cargo} imagem={colaborador.imagem}  />)}
            </div>
        </section>
       
    )
}

export default Time
